import React, { Component } from "react";
//style importer
import * as _ from "./style";
//component importer
//utils importer
import { Link } from "react-router-dom";
type State = typeof initState;
const initState = {
  string: "Hello my friend" as string,
};
class MainMenu extends Component<{}, State> {
  state = initState;

  renderHeaderBtn = () => {
    return (
      <React.Fragment>
        <_.HeaderBtn>
          <_.LinkRoute to="/">Home</_.LinkRoute>
        </_.HeaderBtn>
        <_.HeaderBtn>
          <_.LinkRoute to="/about-us">About us</_.LinkRoute>
        </_.HeaderBtn>
        <_.HeaderBtn>
          <_.LinkRoute to="/documents">Docs</_.LinkRoute>
        </_.HeaderBtn>
        <_.HeaderBtn>
          <_.LinkRoute to="/git">Git</_.LinkRoute>
        </_.HeaderBtn>
      </React.Fragment>
    );
  };

  render() {
    return <_.Container>{this.renderHeaderBtn()}</_.Container>;
  }
}

export default MainMenu;
